  const startRes = await fetch\(API + ''/diagnostic-runs/'' + RUN_ID + ''/interpret/start'', {
    method: ''POST'',
    headers: {
      ''Authorization'': ''Bearer '' + TOKEN,
      ''Content-Type'': ''application/json''
    },
    body: JSON.stringify\({ restart: true }\)
  }\);

  console.log\(''   Status:'', startRes.status\);
  const startText = await startRes.text\(\);
  console.log\(''   Response:'', startText.slice\(0, 500\)\);

  if \(startRes.status >= 400\) {
    console.log\(''\\n   Error - check response above''\);
    return;
  }

  const startData = JSON.parse\(startText\);
  console.log\(''   Session ID:'', startData.session_id\);
  console.log\(''   Initial status:'', startData.status\);

  // If already completed or has sections, show them
  if \(startData.status === ''completed'' || startData.overview_sections?.length > 0\) {
    console.log\(''\\n=== Already complete! ===''\);
    console.log\(''   Sections:'', \(startData.overview_sections || []\).length\);
    return;
  }

  // Step 2: Poll for completion
  console.log\(''\\n2. Polling for completion \(max 90s\)...''\);
  let attempts = 0;
  const maxAttempts = 45;
  let currentStatus = startData.status;

  while \(attempts < maxAttempts\) {
    await new Promise\(r => setTimeout\(r, 2000\)\);
    attempts++;

    const statusRes = await fetch\(API + ''/diagnostic-runs/'' + RUN_ID + ''/interpret/status'', {
      headers: { ''Authorization'': ''Bearer '' + TOKEN }
    }\);
    const statusData = await statusRes.json\(\);
    currentStatus = statusData.status;

    let stageInfo = ''   ['' + attempts + ''] '' + currentStatus;
    if \(statusData.loop_round\) stageInfo += '' \(round '' + statusData.loop_round + ''\)'';
    console.log\(stageInfo\);

    // Handle awaiting_answers
    if \(currentStatus === ''awaiting_answers''\) {
      const pq = statusData.pending_questions || [];
      console.log\(''   >>> '' + pq.length + '' questions pending''\);
      pq.forEach\(\(q, i\) => console.log\(''       Q'' + \(i + 1\) + '': '' + \(q.question_text || ''''\).slice\(0, 50\) + ''...''\)\);

      // Auto-skip for test
      console.log\(''   >>> Auto-skipping...''\);
      await fetch\(API + ''/diagnostic-runs/'' + RUN_ID + ''/interpret/answer'', {
        method: ''POST'',
        headers: { ''Authorization'': ''Bearer '' + TOKEN, ''Content-Type'': ''application/json'' },
        body: JSON.stringify\({ answers: pq.map\(q => \({ question_id: q.question_id, answer: null, skipped: true }\)\) }\)
      }\);
      continue;
    }

    if \([''completed'', ''complete'', ''failed'', ''force_finalized''].includes\(currentStatus\)\) break;
  }

  // Step 3: Get report
  console.log\(''\\n3. Fetching report...''\);
  const reportRes = await fetch\(API + ''/diagnostic-runs/'' + RUN_ID + ''/interpret/report'', {
    headers: { ''Authorization'': ''Bearer '' + TOKEN }
  }\);

  console.log\(''   Status:'', reportRes.status\);
  if \(reportRes.ok\) {
    const report = await reportRes.json\(\);
    console.log\(''   Quality:'', report.quality_status\);
    console.log\(''   Rounds:'', report.rounds_used\);
    console.log\(''   Questions asked:'', report.total_questions_asked || 0\);
    console.log\(''   Sections:'', \(report.sections || []\).length\);

    if \(report.sections?.length > 0\) {
      console.log\(''\\n   --- Overview Sections ---''\);
      report.sections.forEach\(\(s, i\) => console.log\(''   ['' + \(i + 1\) + ''] '' + s.id + '': '' + \(s.content || ''''\).slice\(0, 80\) + ''...''\)\);
    }

    console.log\(''\\n=== SUCCESS ===''\);
    console.log\(''URL: https://cfodiagnosisv1.vercel.app/report/'' + RUN_ID\);
  } else {
    console.log\(''   Error:'', await reportRes.text\(\)\);
  }
}

